import './Main.css'

function Main() {
  return (
    <div className="notif_card unread">
        <img src="https://cdn0.iconfinder.com/data/icons/find-a-job-and-interview-flat/512/employee_person_man_business_office_businessman_people_male_worker-256.png" alt="avatar" />
        <div className="description">
            <p className="user_activity"></p>
        </div>
    </div>
  )
}

export default Main
